INSERT INTO `post` VALUES (1,'2022-11-18 20:32:42','nSQdJKGtcmabJtzPstowRURCGqCdvHmCpvwvbKuyNsdyQPUn','1','Emurgo, the official commercial arm and a founding entity of the Cardano blockchain, plans to launch USDA, a U.S.-pegged stablecoin, in early 2023, the company told CoinDesk. USDA will be the first fully fiat-backed, regulatory-compliant stablecoin in the Cardano ecosystem. “The introduction of a fully fiat-backed, regulatory-compliant stablecoin is the next step in realizing the future for our community,”','["news","common","hot","hell-hot"]','data:image/jpeg;base64,','Cardano-Based Regulated Stablecoin USDA Will Hit the Market in Early 2023',NULL,NULL),(2,'2022-11-18 20:32:42','UgJPxrpasfAZrSYxWAMtDgGhXRSysVJMuVrPEDXCRPXZytHH','2','Just yesterday, the Ripple Swell conference wrapped up, with CEO Brad Garlinghouse announcing massive milestones for the adoption of RippleNet and On-Demand Liquidity (ODL). One of the main focuses of the conference was on the development of Central Bank Digital Currencies (CBDCs).In a new blog post, Ripple has now also revealed that the company is projecting massive growth over the next year. At the conference, Garlinghouse announced that nearly 40 payout markets are now live on ODL, representing 90% of the currency markets.','["news","common", "hot","hell-hot"]','data:image/jpeg;base64,КrHrrDhafbV5JI0GkT+Xyh2O8DDT6aFMPThx9fmXMuJemFKbT3aFG4TtGM9dOsOx3gsd4G6WFhBY7wvuh2O8Snr6wBVjvCy+HNfUm0Ox3iPOALsd4S2lNhNx70Ox3hFXTW+0AUyEnNnKk6eGw84hHvWPu7xVjvFsyynkuKBADYuRv5QGy3ZhUКAR4TpFkJypy3vaxvEX1imynxXT6CAD7odjvCVrl+WvrDsd4APugsd4a2VJaQo5bOAkAeUYxpDILsd4LHeCx3gsd4AXeEoy38O3rB90HwkRPnAF2O8ICx+UOx3iEpI130gCglTnRPih2O8Io8V72h2O8AFjvBY7wWO8FjvAC+6D7oFLydPlCSP0gCrHeCx3gsd4LHeACx3hOLUtRUrrbqBDsd4LHeAEpHd+9/th2O8JZv/P8ASHY7wAfdBY7wkouvT4oru1fxRDeAf//Z','Ripple Rolls Out Machine Learning For ODL To Tackle Significant Growth',NULL,NULL),(3,'2022-11-18 20:32:42','MOGRADjxdhrDTldErsxIDUPwbjfenfwgFUFMqUjGbUnGYKnZ','1','Crypto lending firm – Genesis – reportedly sought an emergency loan of $1 billion from investors before notifying its clients of suspending redemptions this week. According to The Wall Street Journal, the confidential fundraising document stated that the company needed access to the credit facility by 10 a.m. Monday, specifying a “liquidity crunch due to certain illiquid assets on its balance sheet.” Genesis, however, failed to get the funds.','["hot","hell-hot", "2023"]','data:image/jpeg;base64,','IMPORTANT!!! Confidential Doc Reveals Genesis Sought $1B Emergency Loan From Investors',NULL,NULL),(4,'2022-11-18 20:32:42','MOGRADjxdhrDTldErsxIDUPwbjfenfwgFUFMqUjGbUnGYKnZ','1','Major exchanges such as Binance, OKX, and Huobi, in turn, stopped trading USDC (SOL) without specifying the reason, causing Circle, the issuer of USDC, to speak up.Circle says that USDC on Solana is operating as expected, and there are no issues with issuing or redeeming USDC. USDC is always redeemable 1:1 ratio for US dollars. ','["hot","hell-hot", "2023"]','data:image/jpeg;base64,','Circle: USDC On Solana Operating As Expected',NULL,NULL),(5,'2022-11-18 20:41:02','iWnACqFelQwfgmTMjMhfLoHVXvIxoKknYapcCgplTjUiUKFZ','3','Following the bankruptcy filing, FTX Group tweeted that Kroll had been appointed as its claims agent and offered a link to the U.S. Bankruptcy Court filings for those papers.According to the records, millions are still owing to companies like Bankhaus Scheich Wertpapierspezialist AG, Blockchainfonds II GmbH & Co. K.The Kroll documents also contain a list of 102 debtors, including many companies linked to Alameda Research and FTX, who have filed for Chapter 11 bankruptcy protection','["news","common"]','data:image/jpeg;base64,','List Of Organizations And Individuals That Are Creditors Of FTX Revealed',NULL,NULL),(6,'2022-11-18 20:41:02','CxIVrPrHACmUfeVpMJgGMtfWFAaGDzvjNTxAsEBqSLvxlnbc','2','Temasek, a Singapore-based global investment company possessing a portfolio that is worth $403 billion, is no longer interested in waiting for the outcome of FTX crypto exchange’s Chapter 11 bankruptcy filing.According to a statement released by the multinational conglomerate, it will “write down” its $275 million investment that is composed of a $210 million minority stake for about 1% of the exchange’s international business and a $65 million minority stake for 1.5% in FTX U.S.  “In view of FTX’s financial position, we have decided to write down our full investment in FTX','["news","common"]','data:image/jpeg;base64,','Singapore’s Temasek Says Its $275 Million FTX Investment Is Now Worth Zero',NULL,NULL),(7,'2022-11-18 20:41:02','CxIVrPrHACmUfeVpMJgGMtfWFAaGDzvjNTxAsEBqSLvxlnbc','9','According to a filing from the Uruguayan payments unicorn DLocal, the company has $5.6 million invested in FTX.The company said in its third-quarter earnings report earlier this week that it did not expose crypto exchanges as banking services at this time following the collapse of FTX.According to the filing, DLocal used FTX’s banking services and had deposits of $5.6 million, whose withdrawals were not processed by FTX yet.“In early November 2022, the Company utilized FTX Trading Ltd. (“FTX”) banking services and had deposits of USD 5.6','["news","common"]','data:image/jpeg;base64,','DLocal Announces $5.6 Million Stuck In FTX',NULL,NULL),(8,'2022-11-18 20:41:02','vajOmnTFcgJRqEkPKUstTxYvSbSBFrDOkbpoYDGnVzWyYLHL','1','Internet rumors that the Jump Trading Group’s Jump Crypto cryptocurrency division might shut down as a result of FTX losses have been refuted.On November 17, the company said in a tweet that Jump Crypto would not collapse.Given the rumors flying around, we want to debunk a few things.Jump Crypto is not shutting down. We believe we’re one of the most well-capitalized and liquid firms in crypto.We are still actively investing and trading, so if you’re looking for funding, please get in touch.— jump_crypto         (@jump_)    November 17, 2022','["news","common"]','data:image/jpeg;base64,','Jump Crypto Claims Will Not Shut Down',NULL,NULL),(9,'2022-11-18 20:32:42','nSQdJKGtcmabJtzPstowRURCGqCdvHmCpvwvbKuyNsdyQPUn','1','According to an ‘indicative investment proposition’ document, cryptocurrency lender Nexo made an unfulfilled bid to buy ailing rival BlockFi as part of a planned deal valued at roughly $850 million earlier this year.BlockFi has been unluckyWhen BlockFi received the proposal in July, it was in trouble financially due to an $80 million loss stemming from its involvement in the now-defunct cryptocurrency hedge fund Three Arrows Capital. BlockFi declined Nexo’s proposition and instead stayed with a tentative agreement with FTX.US, which last week filed for bankruptcy together','["news","common", "hot","hell-hot"]','data:image/jpeg;base64,','Nexo Reportedly Offered $850 Million to Acquire Rival BlockFi in July',NULL,NULL);
